import React from "react";
import { Link } from "react-router-dom";
import "./Header.css";

const Header = () => {
  return (
    <div className="NavBar">
      <div>
        <Link to="/">Streamy</Link>
      </div>
      <div>
        <Link to="/">All streams</Link>
      </div>
      <div>
        <Link to="/">Login</Link>
      </div>
    </div>
  );
};

export default Header;
